import { useEffect } from "react";

import Head from "next/head";

import React, { Fragment } from "react";
import { buildUrl } from "react-instafeed";

import Feed from "react-instagram-authless-feed";
import instafeed from "react-instafeed";

import Container from "react-bootstrap/Container";
import Image from "react-bootstrap/Image";
import { Row, Col } from "react-bootstrap";

const Home = () => {
  const options = {
    accessToken: "access...",
    clientId: "client...",
    get: "user", // popular, user
    locationId: null,
    resolution: "standard_resolution", // thumbnail, low_resolution, standard_resolution
    sortBy: "none", // none, least-commented, least-liked, least-recent, most-commented, most-liked, most-recent, random
    tagName: null,
    userId: 123,
  };

  const Instagram = () => {
    const { json, loading, error, abort } = useAbortableFetch(
      buildUrl(options)
    );
    if (loading) return "Loading...";
    if (error) return `Error: ${error}`;
    if (!json) return null;
  };
  const { data, meta, pagination } = json;
  // function removeInstagramImages() {
  //   let elems = document.querySelector(".Feed").getElementsByTagName("IMG");
  //   console.log(elems);
  //   for (let i = 0; i < elems.length; i++) {
  //     let e = elems[i];
  //     e.parentNode.removeChild(e);
  //   }
  // }

  // useEffect(() => {
  //   removeInstagramImages();
  // }, []);

  return (
    <div>
      <Head>
        <title>OJOS</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <Container fluid>
        <Row>
          <Col xs={12} sm={12} md={5}>
            <a href="">
              <div className="landing-image-one">
                <Image
                  fluid
                  src="https://cdn.shopify.com/s/files/1/0021/9919/1618/files/IMG_6049_1200x.jpg?v=1596433120"
                />
                <a href="/products/:id" className="image-description">
                  Some text
                </a>
              </div>
            </a>
          </Col>
          <Col xs={12} sm={12} md={7}>
            <a href="">
              <div className="landing-image-two">
                <Image
                  fluid
                  src="https://cdn.shopify.com/s/files/1/0021/9919/1618/files/KKCO-9_1200x.jpg?v=1595571332"
                />
                <a href="/products/:id" className="image-description">
                  Some text
                </a>
              </div>
            </a>
          </Col>
        </Row>
        <Row>
          <Col xs={12} sm={12} md={6}>
            <a href="">
              <div className="landing-image-three">
                <Image
                  fluid
                  src="https://cdn.shopify.com/s/files/1/0021/9919/1618/files/BREDA-KkCo_Postcard_FINAL-01_f0e05425-7a84-4760-ab29-6765ebfca32e_1200x.jpg?v=1596214451"
                />
                <a href="/products/:id" className="image-description">
                  Some text
                </a>
              </div>
            </a>
          </Col>
          <Col xs={12} sm={12} md={6}>
            <a href="">
              <div className="landing-image-four">
                <Image
                  fluid
                  src="https://cdn.shopify.com/s/files/1/0021/9919/1618/files/C1_0625_1200x.jpg?v=1592541154"
                />
                <a href="/products/:id" className="image-description">
                  Some text
                </a>
              </div>
            </a>
          </Col>
        </Row>
      </Container>
      {/* <Feed username="tiffbouchard" classname="Feed" /> */}
      <Fragment>
        {
          // eslint-disable-next-line no-unused-vars
          data &&
            data.map(({ caption, id, images, tags }, index) => {
              const image = images[options.resolution];
              return (
                <Image
                  key={index}
                  url={image.url}
                  title={caption.text}
                  caption={caption.text}
                  width={image.width}
                  height={image.height}
                />
              );
            })
        }
      </Fragment>
    </div>
  );
};

export default Home;
